import React , { Component} from 'react';

import "./DetectPotential.css";
export default class DetectPotential extends Component {

	render() {
		return(

			<section>
				<div className="detectWrapper">
					<owlCrousel className="owl-theme" items="3" autoplay dots nav>
						<div className="item">
							<img src="images/AdobeStock_1.jpeg" />
						</div>
						<div className="item">
							<img src="images/AdobeStock_2.jpeg" />
						</div>
						<div className="item">
							<img src="images/AdobeStock_3.jpeg" />
						</div>
						<div className="item">
							<img src="images/AdobeStock_1.jpeg" />
						</div>

					</owlCrousel>
				</div>

			</section>


			)
	}
}
